import React, { useState } from 'react';
import axios from 'axios';
import { RingLoader } from 'react-spinners';
import './App.css';

function App() {
  const [insertValue, setInsertValue] = useState('');
  const [deleteValue, setDeleteValue] = useState('');
  const [searchValue, setSearchValue] = useState('');
  const [searchResult, setSearchResult] = useState(null);
  const [notification, setNotification] = useState([]);
  const [loading, setLoading] = useState(false);
  const [selectedHashing, setSelectedHashing] = useState('extendible');
  const [hashTableState, setHashTableState] = useState(null);

  const handleInsert = async (e) => {
    e.preventDefault();
    const valueNumber = parseInt(insertValue);

    if (isNaN(valueNumber) || valueNumber < 0) {
      addNotification('error', 'Please enter a valid positive integer for insertion.');
      return;
    }

    setLoading(true);
    try {
      const response = await axios.post(`http://127.0.0.1:5000/${selectedHashing}/insert`, {
        value: valueNumber,
      });

      if (response.data && response.data.state) {
        addNotification('success', response.data.message);
        setHashTableState(response.data.state);
      } else {
        throw new Error("Invalid response structure");
      }

      setInsertValue('');
    } catch (error) {
      const errorMessage = error.response?.data?.error || 'Error inserting data: ' + error.message;
      addNotification('error', errorMessage);
    } finally {
      setLoading(false);
    }
  };

  const handleDelete = async (e) => {
    e.preventDefault();
    const valueNumber = parseInt(deleteValue);

    if (isNaN(valueNumber) || valueNumber < 0) {
      addNotification('error', 'Please enter a valid positive integer for deletion.');
      return;
    }

    setLoading(true);
    try {
      const response = await axios.post(`http://127.0.0.1:5000/${selectedHashing}/delete`, {
        value: valueNumber,
      });

      if (response.data && response.data.state) {
        addNotification('success', response.data.message);
        setHashTableState(response.data.state);
      } else {
        throw new Error("Invalid response structure");
      }

      setDeleteValue('');
    } catch (error) {
      const errorMessage = error.response?.data?.error || 'Error deleting data: ' + error.message;
      addNotification('error', errorMessage);
    } finally {
      setLoading(false);
    }
  };

  const handleSearch = async (e) => {
    e.preventDefault();
    const valueNumber = parseInt(searchValue);

    if (isNaN(valueNumber) || valueNumber < 0) {
      addNotification('error', 'Please enter a valid positive integer for search.');
      return;
    }

    setLoading(true);
    try {
      const response = await axios.post(`http://127.0.0.1:5000/${selectedHashing}/search`, {
        value: valueNumber,
      });

      if (response.data && response.data.result !== undefined) {
        setSearchResult(response.data.result);
        addNotification('success', `Found value ${searchValue}: ${response.data.result}`);
        setHashTableState(response.data.state);
      } else {
        throw new Error("Invalid response structure");
      }

      setSearchValue('');
    } catch (error) {
      const errorMessage = error.response?.data?.error || 'Error searching data: ' + error.message;
      addNotification('error', errorMessage);
    } finally {
      setLoading(false);
    }
  };

  const addNotification = (type, message) => {
    const newNotification = { id: new Date().getTime(), type, message };
    setNotification((prev) => [...prev, newNotification]);
  };

  const handleReset = () => {
    setInsertValue('');
    setDeleteValue('');
    setSearchValue('');
    setSearchResult(null);
    setNotification([]);
    setHashTableState(null);
  };

  const renderHashTableState = () => {
    if (!hashTableState) return null;

    return (
      <div className="hash-table-state">
        <h2>Hash Table State</h2>
        <div><strong>Global Depth:</strong> {hashTableState.global_depth}</div>
        {Object.entries(hashTableState.buckets).map(([index, bucket]) => (
          <div key={index}>
            <strong>Bucket {index} (Local Depth: {hashTableState.local_depths[index]}):</strong> {JSON.stringify(bucket)}
          </div>
        ))}
        <div><strong>Directory:</strong> {JSON.stringify(hashTableState.directory)}</div>
      </div>
    );
  };

  return (
    <div className="app-container">
      <div className="App">
        <div className="main-content">
          <h1>{selectedHashing.charAt(0).toUpperCase() + selectedHashing.slice(1)} Hashing Visualization</h1>

          {/* Dropdown for selecting hashing type */}
          <select
            value={selectedHashing}
            onChange={(e) => setSelectedHashing(e.target.value)}
            disabled={loading}
          >
            <option value="extendible">Extendible Hashing</option>
            <option value="linear">Linear Hashing</option>
          </select>

          <form onSubmit={handleInsert} className="form-section">
            <h2>Insert</h2>
            <input
              type="number"
              placeholder="Value"
              value={insertValue}
              onChange={(e) => setInsertValue(e.target.value)}
              disabled={loading}
            />
            <button type="submit" disabled={loading}>Insert</button>
          </form>

          <form onSubmit={handleDelete} className="form-section">
            <h2>Delete</h2>
            <input
              type="number"
              placeholder="Value"
              value={deleteValue}
              onChange={(e) => setDeleteValue(e.target.value)}
              disabled={loading}
            />
            <button type="submit" disabled={loading}>Delete</button>
          </form>

          <form onSubmit={handleSearch} className="form-section">
            <h2>Search</h2>
            <input
              type="number"
              placeholder="Value"
              value={searchValue}
              onChange={(e) => setSearchValue(e.target.value)}
              disabled={loading}
            />
            <button type="submit" disabled={loading}>Search</button>
          </form>

          {loading && (
            <div className="loading-indicator">
              <RingLoader size={50} color={'#123abc'} loading={loading} />
            </div>
          )}

          <div className="reset-container">
            <button onClick={handleReset}>Reset</button>
          </div>

          {searchResult && (
            <div className="search-result">
              <h3>Search Result:</h3>
              <p>{searchResult}</p>
            </div>
          )}

          {renderHashTableState()}
        </div>

        {/* Notification Panel */}
        <div className="notification-panel">
          <h2>Notifications</h2>
          {notification.map((note) => (
            <div key={note.id} className={`notification ${note.type}`}>
              <span>{note.message}</span>
              <button onClick={() => setNotification(notification.filter((n) => n.id !== note.id))}>
                âœ–
              </button>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default App;
